import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Body from "./body";

ReactDOM.render(
    <React.StrictMode>
        <App name="John" />
    </React.StrictMode>,
    document.getElementById('header')
);



ReactDOM.render(
    <React.StrictMode>
        <Body />
    </React.StrictMode>,
    document.getElementById('body')
);
